  function getClosestPlayer() { 
    let closestDistance = 1000000;
    let closestPlayer = null;
    let players = parcel.getPlayers();
    for (let i = 0; i < players.length; i++) {
      let player = players[i];  
      let distance = Vector3.Distance(startPosition, player.position);
      if (distance < closestDistance) {
        closestPlayer = player;
        closestDistance = distance;    
      }
    }
    return closestPlayer;  
  }

  setInterval(() => {
    //console.log("interval");
    let p = getClosestPlayer();

    if (p== null) {
      return
    }

    let v1 = startPosition
    let v2 = p.position
    let angle = Math.atan2(v1.z - v2.z, v1.x - v2.x) - (Math.PI / 2)
    //console.log("angle", angle)
    feature.rotation.y = Math.PI / -2 - angle

    if (!jumping && Vector3.Distance(feature.position, v2) < 3) {
      startJumping();
    }
  }, 200) 

  setInterval(() => {
     if (jumping) {
       let progress = (Date.now() - jumpingStart) / JUMP_TIME;
       //console.log("JUMP progress", progress)
       if (progress > 1) {
         jumping = false;
         feature.position.y = startPosition.y; 
       } else {
         if (progress <= 0.5) {
           feature.position.y = startPosY + progress;
          } else {
        feature.position.y = startPosY + 1.0 - progress;
      }
       }

